const ReducerQ1List = ({ ingredients, setIngredients, state }) => {
  const deleteIngredients = (id) => {
    const filter = ingredients.filter((ingredient) => ingredient.id !== id);
    setIngredients(filter);
  };

  return (
    <tbody>
      {state.map((ingredient) => (
        <tr>
          <td>{ingredient.name}</td>
          <td>{ingredient.price}</td>
          <td>
            <button
              onClick={() => {
                deleteIngredients(ingredient.id);
              }}
            >
              삭제
            </button>
          </td>
        </tr>
      ))}
    </tbody>
  );
};
export default ReducerQ1List;
